import{_ as e,o as r,c as o,O as t}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 18.2-474.1 Delivery of drugs, firearms, explosives, etc., to prisoners or committed persons.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-474.1.md","filePath":"vacode/18.2-474.1.md"}'),i={name:"vacode/18.2-474.1.md"},a=t('<h1 id="§-18-2-474-1-delivery-of-drugs-firearms-explosives-etc-to-prisoners-or-committed-persons" tabindex="-1">§ 18.2-474.1 Delivery of drugs, firearms, explosives, etc., to prisoners or committed persons. <a class="header-anchor" href="#§-18-2-474-1-delivery-of-drugs-firearms-explosives-etc-to-prisoners-or-committed-persons" aria-label="Permalink to &quot;§ 18.2-474.1 Delivery of drugs, firearms, explosives, etc., to prisoners or committed persons.&quot;">​</a></h1><p>Notwithstanding the provisions of § <a href="http://law.lis.virginia.gov/vacode/18.2-474/" target="_blank" rel="noreferrer">18.2-474</a>, any person who shall willfully in any manner deliver, attempt to deliver, or conspire with another to deliver to any prisoner confined under authority of the Commonwealth of Virginia, or of any political subdivision thereof, or to any person committed to the Department of Juvenile Justice in any juvenile correctional center, any drug which is a controlled substance regulated by the Drug Control Act in Chapter 34 (§ <a href="http://law.lis.virginia.gov/vacode/54.1-3400/" target="_blank" rel="noreferrer">54.1-3400</a> et seq.) of Title 54.1 or marijuana is guilty of a Class 5 felony. Any person who shall willfully in any manner so deliver or attempt to deliver or conspire to deliver to any such prisoner or confined or committed person, firearms, ammunitions, or explosives of any nature is guilty of a Class 3 felony.</p><p>Nothing herein contained shall be construed to repeal or amend § <a href="http://law.lis.virginia.gov/vacode/18.2-473/" target="_blank" rel="noreferrer">18.2-473</a>.</p><p>1975, c. 608; 1982, c. 490; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0384" target="_blank" rel="noreferrer">384</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0410" target="_blank" rel="noreferrer">410</a>; 2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0707" target="_blank" rel="noreferrer">707</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0782" target="_blank" rel="noreferrer">782</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0674" target="_blank" rel="noreferrer">674</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0719" target="_blank" rel="noreferrer">719</a>.</p>',4),n=[a];function s(l,c,p,f,d,g){return r(),o("div",null,n)}const m=e(i,[["render",s]]);export{v as __pageData,m as default};
